  false,\n\t\"url\": null,\n\t\"notes\": \"This data set consists of a bare earth
  data set of 498 files covering a geographic area of 175 square miles in western
  Seminole County, Florida and includes small portions of adjacent Orange and Lake
  Counties. The lidar data was collected June 5-7, 2005. This data set seems to contain
  only model keypoints (points that are a thinned data set that is intended to remove
  extraneous data such as trees and points that are deemed redundant to the final
  bare earth product) that are classified as ground points. As a result, there are
  a lower number of points than in a full mass point lidar data set; and it is recommended
  that the data be downloaded as points and used with a TIN (Triangulated Irregular
  Network) or similar algorithm to produce a bare earth surface.\",\n\t\"license_title\":
